!function(){var o=angular.module("endigoApp",["ngRoute"]);o.config(["$routeProvider",function(o){o.when("/",{templateUrl:"app/views/home.html",controller:"homeController"}).when("/project/:id",{templateUrl:"app/views/project.html",controller:"projectController"}).otherwise({redirectTo:"/"})}]),o.controller("homeController",["$scope","$http",function(o,e){e.get("app/projects.json").success(function(e){o.projects=e.projects})}]),o.controller("projectController",["$scope","$route","$http",function(o,e,t){o.$route=e,o.projectID=e.current.params.id,t.get("app/projects.json").success(function(e){o.projects=e.projects,o.project=o.projects[o.projectID]})}])}();